import firebase from './FirebaseConfig.js'

const GoogleSignIn = (provider) => {
    return firebase
    .auth()
    .signInWithPopup(provider)
    .then((res) => {
        return res.user;
    })
    .catch((er) => {
        return er;
    })
}

export default GoogleSignIn;
